import React from "react";

const VideoList = ({ video }) => {
  return (
    <div className="item">
      <img
        className="ui image"
        src={video.snippet.thumbnails.medium.url}
        alt="video-img"
      />
      {video.snippet.title}
    </div>
  );
};

export default VideoList;
